using System;
using System.Collections.Generic;

namespace BA3A
{
    class BA3A
    {
        //A solution to a ROSALIND bioinformatics problem.
        //Problem Title: Generate the k-mer Composition of a String
        //Rosalind ID: BA3A
        //URL: http://rosalind.info/problems/ba3a/
        static void Main(string[] args)
        {
            string kmer(string text, int i, int k)
            {
                //substring of text from i-th position for the next k letters
                return text.Substring(i, k);
            }
            List<string> Lwindows(string text, int L)
            {
                //list of all L-windows in text
                List<string> windows = new List<string>();
                for (int i = 0; i < text.Length - L + 1; i++)
                {
                    windows.Add(kmer(text, i, L));
                }
                return windows;
            }

            List<string> kmercomposition(string text,int k)
            {
                //lexicographic order
                List<string> sorted = Lwindows(text, k);
                sorted.Sort();
                return sorted;
            }


            string x = "5\nCAATCCAAC";
            //string x = "100\";
            string[] inlines = x.Split();
            string text = inlines[1];
            int k = int.Parse(inlines[0]);
            List<string> res = kmercomposition(text, k);
            foreach (string s in res)
            {
                Console.WriteLine(s);
            }

        }
    }
}
